INSERT INTO `Comment` VALUES (3,'Компилятор должен стоять в голове. Если программист надеется на IDE, то код он пишет значительно дольше ибо не понимает о чем он пишет, тупо сидит и перебирает варианты, пока IDE не перестанет подчеркивать.\r\nГоворят, что программист должен видеть решаемую проблему с высоты комплексной задачи, поставленной перед ним и чем больше высота, с которой он смотрит, тем быстрее и качественнее он кодирует. Разве я не праф?',60,NULL,'2013-12-15 23:15:30',1),(4,'Просто шикарный тест. По-сути тесты Java на этом сайте - большая база знаний по тонкостям языка и его библиотекам. Я, прочитав больше половины книги Шилдта, всё равно узнал очень и очень много. Жалко что нет функции \"генерация теста из тех вопросов, на которые ещё не отвечал\". А то часто попадаются ранее решённые и приходится гонять тест много раз, чтобы узнать что-то новое.',60,NULL,'2013-12-15 23:19:54',1),(5,'Здравствуйте, хочу добавить вопрос. Написано \" добавляйте вопросы через специальную форму на странице с описанием тестов\", не могу найти эту спецальную форму.',60,NULL,'2013-12-15 23:20:10',1),(6,'sagadsghadhgad',60,NULL,'2013-12-16 16:22:27',1),(7,'Здравствуйте, хочу добавить вопрос. Написано \" добавляйте вопросы через специальную форму на странице с описанием тестов\", не могу найти эту спецальную форму. ',46,NULL,'2013-12-16 16:22:49',1),(8,'Просто шикарный тест. По-сути тесты Java на этом сайте - большая база знаний по тонкостям языка и его библиотекам. Я, прочитав больше половины книги Шилдта, всё равно узнал очень и очень много. Жалко что нет функции \"генерация теста из тех вопросов, на которые ещё не отвечал\". А то часто попадаются ранее решённые и приходится гонять тест много раз, чтобы узнать что-то новое. ',46,NULL,'2013-12-16 16:22:57',1),(9,'Компилятор должен стоять в голове. Если программист надеется на IDE, то код он пишет значительно дольше ибо не понимает о чем он пишет, тупо сидит и перебирает варианты, пока IDE не перестанет подчеркивать. Говорят, что программист должен видеть решаемую проблему с высоты комплексной задачи, поставленной перед ним и чем больше высота, с которой он смотрит, тем быстрее и качественнее он кодирует. Разве я не праф? ',46,NULL,'2013-12-16 16:23:04',1),(10,'fsjasdfjs',56,NULL,'2013-12-16 16:23:43',1),(11,'Take free online classes from 80+ top universities and organizations. Coursera is a social entrepreneurship company partnering with Stanford University.',46,NULL,'2013-12-16 16:46:12',6),(12,'hbdbdabad',46,NULL,'2013-12-16 18:26:40',7),(13,'bdabads',58,NULL,'2013-12-16 18:32:49',1);
