INSERT INTO `Quiz` VALUES (19,'Java - Основы','Тест по Java содержит вопросы, ответы на которые знает большинство разработчиков с минимальным опытом программирования на Java. Тест будет полезен многим, в том числе людям, которые не имеют большого опыта работы с Java и хотят получить минимальное представление о базовых понятиях этого популярного языка программирования. Также этот тест может быть полезен студентам, изучающим Java, для закрепления знаний, полученных в ВУЗ-ах или же в результате самостоятельной работы.',20,5,1,1,0),(46,'Java EE JSP Test','This section contains servlet and jsp quizzes for both beginners and advance learner. You can try it and enhance your web understanding knowledge.',60,12,1,1,0),(53,'English - Adult Learners','For the questions below, please choose the best option to complete the sentence or conversation.',20,5,0,1,1),(54,'C++ Programming Test','This test aims to check basic understanding about programming knowledge, so it will be helpful to participant to grab programming basics and improve knowledge is a mother of all languages and c understanding is developing basics to all. This test aims to check basic understanding about programming knowledge.',50,1,0,1,0),(55,'The Standard Python Quiz','It\'s Python quiz time. You have finally finished our current tutorials for Python. No worries, more tutorials are still being developed, but for now, we have to rest. I would first like to congratulate you on working through those tutorials. Your dedication to learning a new language like Python is impressive, but you might be wondering exactly what you learned or how well you paid attention. That is precisely why we have crafted a quiz. The questions that compose this quiz are designed to test if you understand the basics of Python, but it will not quiz advanced topics. However, this quiz is probably the beginning of a series of quizzes for each tutorial category.',20,1,1,1,1),(56,'Do you know Python? ','Hello! In this quiz I tried to collect the most non-trivial features of Python. The time is unlimited, but, please, don\'t run any Python code during the test. After the end of test your results will be autosubmitted to my server for further analysis. Have fun! ',1,4,1,1,0),(58,'Lorem Ipsum is simply dummy text','Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.',1,1,0,0,0),(59,'Codewars','Achieve code mastery through challenge. Codewars is a collective effort by its users. They are creators - authoring kata to teach various techniques, solving kata with solutions that enlighten others, and commenting with constructive feedback. The leaders among them moderate the content and community.',1,1,0,0,0),(60,'IA-Contest','IA-Contest is a programming contest where you can program your own AIs. The purpose of this competition is to have fun but also to learn the Ruby interactively, social and playful ! IA-Contest is currently only available in French.',1,1,0,0,0),(62,'qwfqwfqw','wrnjwrnbwebweb',1,1,0,1,0);
